create table stock_keeping_units
(
    id                    int unsigned auto_increment comment 'SKU ID'
        primary key,
    source_id             int unsigned default 0                 not null comment '该项数据的拷贝来源，店铺的商品数据为同类平台数据的部分拷贝',
    sku_code              varchar(36)                            not null comment '单品编码',
    product_id            int unsigned                           not null comment '商品ID',
    sorted_spec_value_ids varchar(255)                           not null comment '已排序的规格值ID，逗号分隔',
    price_in_cents        int unsigned                           not null comment '价格（分）',
    sales                 int unsigned                           not null comment '已销售数量',
    stock_count           int unsigned                           not null comment '库存数量',
    is_for_sale           tinyint(1)                             not null comment '是否已上架销售',
    description           text                                   not null comment 'SKU 描述（格式为"规格项01：规格值01；规格项02：规格值02"）',
    created_at            datetime     default CURRENT_TIMESTAMP not null,
    updated_at            datetime                               null,
    deleted_at            datetime                               null
)
    collate = utf8mb4_unicode_ci;

create index stock_keeping_units_product_id_index
    on stock_keeping_units (product_id);

create index stock_keeping_units_sorted_spec_value_ids_index
    on stock_keeping_units (sorted_spec_value_ids);

create index stock_keeping_units_source_id_index
    on stock_keeping_units (source_id);

